import React from "react";
import Particles from 'react-particles-js';

class Intro extends React.Component {
    render() {
        const particleStyle = {
                width: "100%",
                height: "100%",
                position: "fixed",
                "z-index": "-10",
                top: "0",
                left: "0"
        }
        return (
            <main >
                <Particles style={particleStyle}
                    params={{
                        particles: {
                            number: {
                                value: 200,
                                density: {
                                    enable: true,
                                    value_area: 1000,
                                }
                            },
                            color: {
                                value: "#8B0000"
                            },
                            line_linked: {
                                "enable": true,
                                "distance": 110
                            },
                            shape: {
                                "type": "circle",
                                "stroke": {
                                    "width": 1,
                                    "color": "#8B0000"
                                }
                            },
                            opacity: {
                                "value": 0.5,
                                "random": true
                            },
                            size: {
                                "value": 2
                            },
                            move: {
                                "enable": true,
                                "speed": 10
                            }
                        },
                    }}
                />

                <h5 className="center">Introduction Page</h5>
                <p className="center">A basic Intra Mailing system using React, Node, MongoDB, Express</p>

            </main>
        )
    };
}

export default Intro;
